Because I see people do it, and to what effect?!

Case study: I recently saw someone's profile who said "helping people live their best life."...what does that even mean?

This person reached out to me saying they thought we should have a zoom call and get to know each other because we're both in the business of "helping people" (which, BTW, I do not help people: I teach and equip or solve problems and achieve goals with social media marketing).

Before getting on the call, I do some research and I looked at her posts. They were lifestyle advice, trips, pets, and more. I couldn't figure out exactly what it was.

So I clicked the link in the bio. The options? Newsletter, get well, and learn more.

I clicked learn more.

And THEN I saw it. This is not a story knocking MLM's / Network marketers, but she was from a network marketing company.

We hop on the call.

You know what she thinks I need help with? The first thing way she tells me she can "help" me is with weight loss.

Unprompted. Unsolicited. Was never told this was a goal. But I was told I could use help on weight loss.

Normally I say don't use the word help because it's abstract and loose and there's a million better word choices.

Here today, help was used in a toxic way.

So don't say you "help" people. Choose a different word. And actually listen to people.

